    }
      #slot {
        width: 32px;
        height: 32px;
        margin: 1px 3px;
        overflow:hidden;
        display: inline-block;
        border: 3px solid #77B4CC;
        position: relative;
        border-radius: 5px;
        background: #203940;
      }
      #slot img, span {
        user-drag: none;
        user-select: none;
        -moz-user-select: none;
        -webkit-user-drag: none;
        -webkit-user-select: none;
        -ms-user-select: none;
